it the task graph to the scheduler\n        cpt = [ pca.explained_variance_ , pca.singular_values_]\n        explained_variance ,singular_values  = client.persist(cpt)\n        explained_variance , singular_values = client.compute([explained_variance ,singular_values])    \n        print(\"explained_variance ,singular_values: \", explained_variance.result(), \" and \" , singular_values.result(), flush=True)\nprint(\"Done in :\", time.perf_counter() - t, flush=True)\n\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1448","type":"AllLabels"},{"attributes":{},"id":"1376","type":"LinearScale"},{"attributes":{},"id":"1485","type":"AllLabels"},{"attributes":{},"id":"1455","type":"AllLabels"},{"attributes":{"coordinates":null,"data_source":{"id":"1213"},"glyph":{"id":"1394"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1396"},"nonselection_glyph":{"id":"1395"},"view":{"id":"1398"}},"id":"1397","type":"GlyphRenderer"},{"attributes":{},"id":"1320","type":"UnionRenderers"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"axis":{"id":"1382"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1385","type":"Grid"},{"attributes":{"axis_label":"Percentage","coordinates":null,"formatter":{"id":"1476"},"group":null,"major_label_policy":{"id":"1477"},"ticker":{"id":"1231"}},"id":"1230","type":"LinearAxis"},{"attributes":{"overlay":{"id":"1024"}},"id":"1021","type":"BoxZoomTool"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1550"},{"id":"1551"},{"id":"1552"},{"id":"1553"},{"id":"1554"},{"id":"1555"},{"id":"1556"},{"id":"1557"},{"id":"1558"},{"id":"1559"},{"id":"1560"},{"id":"1561"}]},"id":"1379","type":"DatetimeTicker"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"coordinates":null,"group":null,"text":"Number of File Descriptors"},"id":"1369","type"
